import React from 'react';

export default function Home () {
    return (
        <div style={{
            backgroundColor: 'lavender',
            position: 'fixed',
            top: '0px',
            left:'0',
            zIndex: '999',
            width: '100%',
            height: '100vh',
            display: 'flex',
            gridTemplateColumns: 'repeat(3, 1fr)',
            gridTemplateRows: '100%',
            gridGap: '10px',
            margin: 'auto 0',
            fontSize: '40px',
            justifyContent: 'center',
            alignContent: 'center',
              }
        }>
            <h1 style={{ gridRow: '3 / 2'}}>TAYLER RADCLIFFE</h1>
        </div>
    )
}
